import React from 'react';

export default function LinkedinSection() {
  return (
    <section id="linkedin" className="section">
      <h2>Connect with Us on LinkedIn</h2>
      <p>
        Follow our updates and join the conversation on{' '}
        <a
          href="https://www.linkedin.com/company/ct-digital-forum"
          target="_blank"
          rel="noopener noreferrer"
        >
          LinkedIn
        </a>.
      </p>
    </section>
  );
}
